INSERT INTO `a0d19_content` (`id`, `asset_id`, `title`, `alias`, `title_alias`, `introtext`, `fulltext`, `state`, `sectionid`, `mask`, `catid`, `created`, `created_by`, `created_by_alias`, `modified`, `modified_by`, `checked_out`, `checked_out_time`, `publish_up`, `publish_down`, `images`, `urls`, `attribs`, `version`, `parentid`, `ordering`, `metakey`, `metadesc`, `access`, `hits`, `metadata`, `featured`, `language`, `xreference`) VALUES
(1, 36, 'О проекте', 'o-proekte', '', '<ul>\r\n<li><a href="#1">Для чего был создан этот проект?<br /><br /></a></li>\r\n<li><a href="#2">Можно ли размещать чужие фотографии или использовать чужое видео для своего портфолио?<br /><br /></a></li>\r\n<li><a href="#3">Существует ли ограничение на загрузку фотографий и публикацию видео?<br /><br /></a></li>\r\n<li><a href="#video">Как добавить видео в свое портфолио?<br /><br /></a></li>\r\n<li><a href="#4">Как происходит сортировка пользователей в категориях?<br /><br /></a></li>\r\n<li><a href="#rating">Что такое рейтинг?<br /><br /></a></li>\r\n<li><a href="#5">Получаем ли мы Ваши пароли для ВКонтакте при написании Отзывов?<br /><br /></a></li>\r\n<li><a href="#15">Как выйти из модуля Отзывы? / Как сменить пользователя, чтобы добавить новый отзыв?<br /><br /></a></li>\r\n<li><a href="#16">Как удалить отрицательный Отзыв?<br /><br /></a></li>\r\n<li><a href="#comments">Есть ли ограничение на количество Отзывов?<br /><br /></a></li>\r\n<li><a href="#6">Как определяются популярные фотографы на Главной странице?<br /><br /></a></li>\r\n<li><a href="#7">У меня возникли подозрения на накрутку рейтинга, куда обращаться?<br /><br /></a></li>\r\n<li><a href="#8">Мой рейтинг не изменялся, но количество звездочек в профиле стало меньше/больше. Почему?<br /><br /></a></li>\r\n<!--<li><a href="#9">Возможна ли покупка рейтинга?<br /><br /></a></li>\r\n<li><a href="#10">Принимаете ли Вы к оплате Webmoney?<br /><br /></a></li>-->\r\n<li><a href="#11">Какие фотографии отображаются в блоке "Случайное фото" на Главной странице?<br /><br /></a></li>\r\n<li><a href="#12">Существует ли на сайте модерация анкет, фотографий и видеофайлов?<br /><br /></a></li>\r\n<li><a href="#13">Существует ли на сайте модерация акций и новостей, добавляемых пользователями?<br /><br /></a></li>\r\n<!--li><a href="#pro">Чем отличается PRO-аккаунт от обычного аккаунта?<br /><br /></a></li>\r\n<li><a href="#new">Что означает иконка <img src="images/system/new_icon.gif" border="0" alt="Новичок" title="Новичок" />?<br /><br /></a></li--> <!--li><a href="#17">Инструкция по оплате PRO-аккаунта через Webmoney<br /><br /></a></li>\r\n<li><a href="#18">Инструкция по оплате PRO-аккаунта через VISA QIWI Кошелек<br /><br /></a></li>\r\n<li><a href="#19">Инструкция по оплате PRO-аккаунта через Яндекс.Деньги<br /><br /></a></li>\r\n<li><a href="#22">Инструкция по оплате PRO-аккаунта через Сбербанк ОнЛ@йн<br /><br /></a></li>\r\n<li><a href="#21">Инструкция по оплате PRO-аккаунта со счета мобильного телефона МТС, Мегафон<br /><br /></a></li>\r\n<li><a href="#20">Инструкция по оплате PRO-аккаунта пластиковыми картами MasterCard, VISA, Maestro<br /><br /></a></li-->\r\n<li><a href="#14">Как мне удалить анкету с сайта?<br /><br /></a></li>\r\n</ul>\r\n<h3 id="1"><br />Для чего был создан этот проект?</h3>\r\n<p>Как из огромного моря предложений, которыми заполнен интернет, найти именно того мастера, который нужен Вам? Чтобы сделать фотографию, которая будет удовлетворять вашим запросам, не потеряв при этом ни времени, ни денег, ни хорошего настроения, надо обратиться к настоящему профессионалу. Но как определить, что фотограф действительно профи в своём деле? Если у вас под рукой есть свой собственный фотограф – вам повезло! А если нет? Чему мы доверяем? На что ориентируемся, когда ищем специалиста, будь то врач, учитель, строитель или фотограф? Чаще всего, на мнение тех людей, которые уже пользовались услугами того или иного специалиста. Если нам при этом предоставляется возможность ознакомиться с работами мастера и самостоятельно оценить уровень его мастерства – ещё лучше! Для этого мы и создали этот Проект - предоставить потребителю возможность выбрать лучшего среди лучших с учётом собственных требований и личных возможностей. А учитывая, что искусство фотографии многогранно и не ограничивается только изготовлением фото на паспорт, мы приглашаем на Проект всех, чья деятельность так или иначе связана с этой интересной, творческой и такой разнообразной профессией! Мы приглашаем к сотрудничеству тех, кто уже заявил о себе, как о классном специалисте, и тех, кто только начинает свой путь в этом прекрасном искусстве «застигнутого врасплох времени»!</p>\r\n<h3 id="2"><br />Можно ли размещать чужие фотографии или использовать чужое видео для своего портфолио?</h3>\r\n<p>Нет, Вы имеете право размещать только те фотографии и видеозаписи, права на использования которых принадлежат именно Вам. Не забывайте о правах третьих лиц, которые изображены на Ваших фото и видео.</p>\r\n<h3 id="3"><br />Существует ли ограничение на загрузку фотографий и публикацию видео?</h3>\r\n<ul>\r\n<li>Для Фотографов существует ограничение на загрузку фотографий в портфолио: 50 фото на каждый из Типов съемки.</li>\r\n<li>Видеооператоры могут разместить в своем портфолио до 20 видеороликов включительно.</li>\r\n<li>Остальным Участникам проекта доступна возможность загрузить в портфолио 50 фотографий максимум.</li>\r\n</ul>\r\n<h3 id="video"><br />Как добавить видео в свое портфолио?</h3>\r\n<table border="1">\r\n<tbody>\r\n<tr>\r\n<td style="padding: 5px;" colspan="2" align="center" bgcolor="#666666"><span style="color: #ffffff;"><strong>ВКонтакте</strong></span></td>\r\n</tr>\r\n<tr>\r\n<td align="center" height="65">Открываем нужное видео</td>\r\n<td rowspan="3"><img src="images/system/v1.jpg" border="0" /></td>\r\n</tr>\r\n<tr>\r\n<td align="center" height="65">Под фамилией отправителя в правом нижнем углу переходим по ссылке Редактировать/Поделиться</td>\r\n</tr>\r\n<tr>\r\n<td align="center" height="65">В выпадающем меню выбираем пункт "Получить код видео"</td>\r\n</tr>\r\n<tr>\r\n<td align="center">Копируем получившийся код</td>\r\n<td><img src="images/system/v2.jpg" border="0" /></td>\r\n</tr>\r\n<tr>\r\n<td align="center">Вставляем его в соответствующее поле в Вашем портфолио и жмем кнопку <strong>Сохранить</strong></td>\r\n<td><img src="images/system/v3.jpg" border="0" /></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table border="1">\r\n<tbody>\r\n<tr>\r\n<td style="padding: 5px;" colspan="2" align="center" bgcolor="#666666"><span style="color: #ffffff;"><strong>YouTube</strong></span></td>\r\n</tr>\r\n<tr>\r\n<td align="center">Алгоритм добавления видео с YouTube идентичен алгоритму для ВКонтакте.<br /><br />Под видео нажимаем на ссылку "Поделиться", потом на ссылку "Сгенерировать HTML-код", а получившийся код вставляем в свое портфолио и жмем на кнопку <strong>Сохранить</strong></td>\r\n<td><img src="images/system/v4.jpg" border="0" /></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table border="1">\r\n<tbody>\r\n<tr>\r\n<td style="padding: 5px;" colspan="2" align="center" bgcolor="#666666"><span style="color: #ffffff;"><strong>Vimeo</strong></span></td>\r\n</tr>\r\n<tr>\r\n<td align="center">Алгоритм все тот же, что и выше.<br /><br />Открываем видео, в правом верхнем углу нажимаем на кнопку Share</td>\r\n<td><img src="images/system/v6.jpg" border="0" /></td>\r\n</tr>\r\n<tr>\r\n<td align="center">Копируем весь код из поля Embed, вставляем в свое портфолио и жмем на кнопку <strong>Сохранить</strong></td>\r\n<td><img src="images/system/v5.jpg" border="0" /></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<h3 id="4"><br />Как происходит сортировка пользователей в категориях?</h3>\r\n<p>Сортировка участников проекта в каждой отдельной категории происходит по рейтингу. На первом месте находится пользователь с максимальным значеним рейтинга в этой категории. Подробнее про рейтинг Вы можете прочитать ниже.</p>\r\n<h3 id="rating"><br />Что такое рейтинг?</h3>\r\n<p>Рейтинг - балльная система оценки "популярности/авторитетности" участников Проекта. Минимальное значение равно нулю, максимальное значение ничем не ограничено. Рейтинг нового участника минимален, однако, при заполнении анкеты он повышается по следующему алгоритму:</p>\r\n<ul>\r\n<li>+10 к рейтингу за заполнение поля "Телефон"</li>\r\n<li>+10 к рейтингу за заполнение поля "Skype"</li>\r\n<li>+10 к рейтингу за заполнение поля "Адрес личной странички"</li>\r\n<li>+10 к рейтингу за заполнение поля "Страничка Вконтакте"</li>\r\n<li>+10 к рейтингу за заполнение поля "Страничка Facebook"</li>\r\n<li>+10 к рейтингу за заполнение поля "О себе"</li>\r\n<li>+30 к рейтингу за добавление Аватарки/Логотипа</li>\r\n</ul>\r\n<p>Также рейтинг увеличивается на один балл, если Вы зашли в свою учетную запись хотя бы один раз в сутки. <br />За <span style="text-decoration: underline;">ежедневные</span> визиты на сайт Вы будете получать три балла к рейтингу. При пропуске одного и более дней, Вы получите 1 балл при посещении, в последующие дни снова по 3 балла. <strong style="color: red;">PRO-аккаунты</strong> при ежедневном посещении получают 10 баллов. Не забывайте посещать проект, и Ваш рейтинг будет расти с каждым днем.<br /><br />Помимо всего прочего за каждую добавленную новость Вы будете получать по 10 баллов к рейтингу. Чем больше событий в Вашей профессиональной жизни, тем Вы ярче, тем Вы заметнее, тем больше Ваш рейтинг.<br /><br /> Основной способ повышения рейтинга - это <strong>Отзывы</strong>. Их может оставить любой человек, который зарегистрирован в соц. сети ВКонтакте. За каждый Положительный отзыв на Вашей странице Вам будет начислено +20 баллов. За каждый Отрицательный отзыв из Вашего рейтинга будут вычитаться 20 баллов. Один пользователь ВКонтакте может оставить только один отзыв каждому Участнику проекта.<br /><br /><strong style="color: #ff0000;">Ссылка на наш сайт</strong> принесет Вам возможность получить уникальный короткий адрес вида: <a href="#">http://photoso.ru/nickname</a>, а также +200 баллов к рейтингу. Каждая дополнительная ссылка с других сайтов принесет Вам еще по 100 баллов. <br /><strong style="color: #6e2020; font-size: 11px;">Внимание! Данный способ повышения обговаривается отдельно с Администрацией портала посредством электронной почты: <a href="mailto:admin@photoso.ru">admin@photoso.ru</a>.</strong> <br /><br /> <span style="text-decoration: underline;"><strong>Внимание!</strong></span></p>\r\n<ul>\r\n<li>За накрутку рейтинга аккаунты будут блокироваться.</li>\r\n<li>Отзывы могут быть удалены без объяснения причин.</li>\r\n<li>Не пытайтесь испортить рейтинг другим пользователям.</li>\r\n<li>Не пытайтесь обмануть Администрацию, подставив своего коллегу собственноручно накрученными отзывами.</li>\r\n</ul>\r\n<h3 id="5"><br />Получаем ли мы Ваши пароли для ВКонтакте при написании Отзывов?</h3>\r\n<p>Нет. Наш проект использует <a href="http://vk.com/developers.php?oid=-1&amp;p=Auth" target="_blank">Виджет для авторизации</a> от ВКонтакте, поэтому все Ваши пароли остаются только Вашими и дальше. Авторизация предназначена для уменьшения способов накрутки рейтинга.</p>\r\n<h3 id="15"><br />Как выйти из модуля Отзывы? / Как сменить пользователя, чтобы добавить новый отзыв?</h3>\r\n<p>Заходим ВКонтакте, слева в меню выбираем пункт Приложения, затем переходим по вкладке Настройки (справа вверху под кнопкой Выйти), в блоке Внешние сайты напротив пункта Фотографы Сочи нажимаем на ссылку "Убрать".<br />Теперь Вы можете зайти под другим аккаунтом ВКонтакте на наш сайт.</p>\r\n<h3 id="16"><br />Как удалить отрицательный Отзыв?</h3>\r\n<p>Любой отзыв, как отрицательный, так и положительный, удаляется <strong>только</strong> по просьбе человека, оставившего Отзыв. Для этого ему со своего аккаунта Вконтакте необходимо отправить соответствующий запрос администратору группы. <br /><br />Администрация проекта не участвует в расследованиях касательно правдивости того или иного Отзыва. <span style="text-decoration: underline;">Исключением</span> является тот случай, когда Отзыв был оставлен явно фейковым аккаунтом. Остальные письма Администрация будет игнорировать.<br /><br />В том случае, когда недовольный клиент не желает идти на примирение и отправлять запрос на удаление своего Отзыва, но Вам необходимо скрыть/удалить негативную информацию, <span style="text-decoration: underline;">мы можем предложить Вам три выхода из сложившейся ситуации</span>:</p>\r\n<ul>\r\n<li><strong>Оптимальный</strong>: Заработать положительные Отзывы, благодаря чему негативные будут опускаться вниз.</li>\r\n<li><strong>Кардинальный</strong>: Вы вправе потребовать <a href="#14">удалить свою анкету</a> с сайта.</li>\r\n<li><strong>Бизнес есть бизнес</strong>: Использовать платное "восстановление испорченной репутации" - 500 рублей за каждый Отзыв, который необходимо удалить. Обговаривается в индивидуальном порядке после соответствующего запроса на почту: <a href="mailto:admin@photoso.ru">admin@photoso.ru</a>.</li>\r\n</ul>\r\n<p>Уважаемые участники проекта, репутацию тяжело заработать, очень легко потерять и почти невозможно восстановить. Исполняйте Вашу работу качественно, чтобы Отзывы были исключительно "thumbs up"!</p>\r\n<h3 id="comments"><br />Есть ли ограничение на количество Отзывов?</h3>\r\n<p>Да. Во избежание накрутки, по умолчанию для всех участников проекта есть ограничение на 3 положительных отзыва в сутки. При достижении определенного количества, либо при подозрении на накрутку отзывов, участнику может быть выставлено отдельное ограничение, вплоть до 0. При достижении участником 150 и более отзывов, добавление положительных отзывов для пользователя прекращается.<br />На отрицательные отзывы ограничения не распространяются.</p>\r\n<h3 id="6"><br />Как определяются популярные фотографы на Главной странице?</h3>\r\n<p>На главной странице проекта отображаются 8 популярных фотографов с наибольшим значением рейтинга.</p>\r\n<h3 id="7"><br />У меня возникли подозрения на накрутку рейтинга, куда обращаться?</h3>\r\n<p>Вы можете использовать <a href="feedback" target="_blank">Обратную связь</a>. Постарайтесь предоставить максимум информации по Вашим наблюдениям, чтобы нам было на что основываться.</p>\r\n<h3 id="8"><br />Мой рейтинг не менялся, но количество звездочек в профиле стало меньше/больше. Почему?</h3>\r\n<p>Это связано с тем, что максимальный рейтинг Участника из Вашей категории уменьшился/увеличился. Пять звездочек - это максимальное значение рейтинга Вашего коллеги, поэтому при увеличении/уменьшении максимального рейтинга Участника Вашей категории, Ваш рейтинг количественно меняться не будет, но визуально он может измениться.</p>\r\n<!--<h3 id="9"><br />Возможна ли покупка рейтинга?</h3>\r\n<p>Возможна. Но популярность купить нельзя, потому и цена за рейтинг будет "кусаться": 1000 рублей за 20 баллов. Проще добиться авторитета своими работами. Однако, если деньги девать некуда - обращайтесь с соответствующей просьбой через <a href="feedback" target="_blank">Обратную связь</a>.</p>\r\n<h3 id="10"><br />Принимаете ли Вы к оплате Webmoney?</h3>\r\n<p>Да. Участники нашего проекта могут рассчитаться онлайн WebMoney. Расчет может быть произведен в режиме онлайн с WMKeeper или через терминалы самообслуживания. Обратите внимание что мы принимаем только WMR. Оплата производится на защищенном сайте WebMoney. Более подробная инструкция доступна на сайте <a href="http://wiki.webmoney.ru/projects/webmoney/wiki/Способы_оплаты_в_системе_WebMoney" target="_blank">Webmoney</a>.</p>-->\r\n<h3 id="11"><br />Какие фотографии отображаются в блоке "Случайное фото" на Главной странице?</h3>\r\n<p>В блоке "Случайное фото" на главной странице отображаются все без исключения фотографии, добавленными Фотографами. Фотографии Участников проекта, относящихся к другим категориям, в этом блоке не показываются.</p>\r\n<h3 id="12"><br />Существует ли на сайте модерация анкет, фотографий и видеофайлов?</h3>\r\n<p>Изначально как таковая премодерация фото и видео, а также всех данных, которые указаны лично каждым Участником проекта, не ведется. Однако, если на Вас будут поступать обоснованные жалобы, мы оставляем за собой право удалить Ваш аккаунт без объяснения причин.</p>\r\n<h3 id="13"><br />Существует ли на сайте модерация акций и новостей, добавляемых Участниками проекта?</h3>\r\n<p>Да. Все новости, которые добавляются Участниками, проходят предварительную модерацию, дабы предотвратить распространение информации, противоречащей нынешнему законодательству. Мы оставляем за собой право не размещать любые новости по своему усмотрению без объяснения причин, однако, это бывает лишь в крайних случаях.</p>\r\n<!--h3 id="pro"><br />Чем отличается PRO-аккаунт от обычного аккаунта?</h3>\r\n<p>Чем отличается PROфессионал от любителя? PROфессионал зарабатывает деньги, для него съемка это работа, для всех остальных это всего лишь хобби.<br /><br /></p>\r\n<p><strong>Для фотографов</strong>:</p>\r\n<ul>\r\n<li>Сначала по рейтингу сортируются PRO-аккаунты, потом по рейтингу сортируются обычные аккаунты.</li>\r\n<li>На главной странице PRO-аккаунты выделены лучше, чем остальные.</li>\r\n<li>При ежедневном посещении PRO-аккаунты получают по 10 баллов к рейтингу, стандартные аккаунты по 3 балла.</li>\r\n<li>У PRO-аккаунта открыты все контактные данные, а также пункт "О себе". У обычных аккаунтов из контактных данных доступны только e-mail адрес и Личные сообщения.</li>\r\n<li>PRO-аккаунт может добавить в каждый альбом по 50 фотографий, остальные лишь по 20.</li>\r\n<li>PRO-аккаунты имеют возможность добавления до 9 альбомов с произвольным названием, обычный аккаунт может создать только один такой альбом.</li>\r\n<li>PRO-аккаунты имеют возможность добавления до 5 видеороликов в свое портфолио в отличие от стандартных аккаунтов.</li>\r\n<li>У PRO-аккаунтов на странице вместо нашего виджета Вконтакте отображается виджет их собственной группы.</li>\r\n<li>PRO-аккаунты выделяются в списке иконкой <img src="images/system/pro_icon.gif" border="0" alt="Профессионал" title="Профессионал" /></li>\r\n</ul>\r\n<p><strong>Для видеооператоров</strong>:</p>\r\n<ul>\r\n<li>Сначала по рейтингу сортируются PRO-аккаунты, потом по рейтингу сортируются обычные аккаунты.</li>\r\n<li>При ежедневном посещении PRO-аккаунты получают по 10 баллов к рейтингу, стандартные аккаунты по 3 балла.</li>\r\n<li>У PRO-аккаунта открыты все контактные данные, а также пункт "О себе". У обычных аккаунтов из контактных данных доступны только e-mail адрес и Личные сообщения.</li>\r\n<li>PRO-аккаунт может добавить до 20 видеороликов, остальные лишь по 3.</li>\r\n<li>PRO-аккаунт может разместить виджет своей группы у себя на странице.</li>\r\n<li>PRO-аккаунты выделяются в списке иконкой <img src="images/system/pro_icon.gif" border="0" alt="Профессионал" title="Профессионал" /></li>\r\n</ul>\r\n<p><span style="color: #aaa; font-size: 11px;">Ожидается, но <span style="text-decoration: underline;">пока</span> не реализовано:</span></p>\r\n<ul style="color: #aaa; font-size: 11px;">\r\n<li>PRO-аккаунт может изменить вид своего профиля на более продвинутый.</li>\r\n<li>PRO-аккаунт имеет доступ к архиву личных сообщений.</li>\r\n</ul>\r\n<h3 id="new"><br />Что означает иконка <img src="images/system/new_icon.gif" border="0" alt="Новичок" title="Новичок" />?</h3>\r\n<p>Каждый новый участник проекта в течение первых пяти дней после регистрации обладает всеми преимуществами PRO-аккаунта, однако, он отличается иконкой <img src="images/system/new_icon.gif" border="0" alt="Новичок" title="Новичок" /> вместо <img src="images/system/pro_icon.gif" border="0" alt="Профессионал" title="Профессионал" />.</p-->\r\n<p> </p>\r\n<!--h3 id="17"><br />Инструкция по оплате PRO-аккаунта через Webmoney</h3>\r\n<table border="1">\r\n<tbody>\r\n<tr>\r\n<td align="center" bgcolor="#666666" height="35"><span style="color: #ffffff;"><strong>Действия пользователя</strong></span></td>\r\n<td align="center" bgcolor="#666666"><span style="color: #ffffff;"><strong>Картинка (нажми для увеличения)</strong></span></td>\r\n</tr>\r\n<tr>\r\n<td style="padding: 5px;" align="center" height="65">1. Стандартное окно оплаты Webmoney. Нажимаем кнопку "Далее" (Webmoney Keeper должен быть запущен).</td>\r\n<td style="padding: 5px;" align="center" height="65"><a href="images/system/11.jpg" title="1. Стандартное окно оплаты Webmoney. Нажимаем кнопку ''Далее'' (Webmoney Keeper должен быть запущен)." rel="171"><img src="images/system/11small.jpg" border="0" style