твердить''." rel="plata1"><img src="images/system/qiwi6small.jpg" border="0" style="border: 1px solid #000;" /></a></td>\r\n</tr>\r\n<tr>\r\n<td style="padding: 5px;" align="center" height="65">7. Вводим код подтверждения, который пришел нам на сотовый телефон. Нажимаем "Подтвердить".</td>\r\n<td style="padding: 5px;" align="center" height="65"><a href="images/system/qiwi7.jpg" title="7. Вводим код подтверждения, который пришел нам на сотовый телефон. Нажимаем ''Подтвердить''." rel="plata1"><img src="images/system/qiwi7small.jpg" border="0" style="border: 1px solid #000;" /></a></td>\r\n</tr>\r\n<tr>\r\n<td style="padding: 5px;" align="center" height="65">8. Убеждаемся в успешной операции.</td>\r\n<td style="padding: 5px;" align="center" height="65"><a href="images/system/qiwi8.jpg" title="8. Убеждаемся в успешной операции." rel="plata1"><img src="images/system/qiwi8small.jpg" border="0" style="border: 1px solid #000;" /></a></td>\r\n</tr>\r\n<tr>\r\n<td style="padding: 5px;" align="center" height="65">9. Переходим на вкладку с инструкцией по оплате из шага №3. Нажимаем кнопку "Обновить страницу", до тех пор пока не появится сообщение об успешном платеже.</td>\r\n<td style="padding: 5px;" align="center" height="65"><a href="images/system/qiwi3.jpg" title="9. Переходим на вкладку с инструкцией по оплате из шага №3. Нажимаем кнопку ''Обновить страницу'', до тех пор пока не появится сообщение об успешном платеже." rel="plata1"><img src="images/system/qiwi3small.jpg" border="0" style="border: 1px solid #000;" /></a></td>\r\n</tr>\r\n<tr>\r\n<td style="padding: 5px;" align="center" height="65">10. Дождитесь загрузки данной страницы, после чего ОБЯЗАТЕЛЬНО нажмите кнопку "Перейти в интернет-магазин". Без этого деньги будут списаны, а аккаунт продлен не будет. <br />Деньги не пропадут, просто придется обратиться к Администратору через <a href="feedback">Обратную связь</a>.</td>\r\n<td style="padding: 5px;" align="center" height="65"><a href="images/system/qiwi9.jpg" title="10. Дождитесь загрузки данной страницы, после чего ОБЯЗАТЕЛЬНО нажмите кнопку ''Перейти в интернет-магазин''." rel="plata1"><img src="images/system/qiwi9small.jpg" border="0" style="border: 1px solid #000;" /></a></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<h3 id="19"><br />Инструкция по оплате PRO-аккаунта через Яндекс.Деньги</h3>\r\n<table border="1">\r\n<tbody>\r\n<tr>\r\n<td align="center" bgcolor="#666666" height="35"><span style="color: #ffffff;"><strong>Действия пользователя</strong></span></td>\r\n<td align="center" bgcolor="#666666"><span style="color: #ffffff;"><strong>Картинка (нажми для увеличения)</strong></span></td>\r\n</tr>\r\n<tr>\r\n<td style="padding: 5px;" align="center" height="65">1. Во вкладке "Электронные" находим иконку "Яндекс.Деньги".</td>\r\n<td style="padding: 5px;" align="center" height="65"><a href="images/system/ya1.jpg" title="1. Во вкладке ''Электронные'' находим иконку ''Яндекс.Деньги''." rel="173"><img src="images/system/ya1small.jpg" border="0" style="border: 1px solid #000;" /></a></td>\r\n</tr>\r\n<tr>\r\n<td style="padding: 5px;" align="center" height="65">2. На странице Яндекс.Деньги подтверждаем платеж.</td>\r\n<td style="padding: 5px;" align="center" height="65"><a href="images/system/ya2.jpg" title="2. На странице Яндекс.Деньги подтверждаем платеж." rel="173"><img src="images/system/ya2small.jpg" border="0" style="border: 1px solid #000;" /></a></td>\r\n</tr>\r\n<tr>\r\n<td style="padding: 5px;" align="center" height="65">3. Убеждаемся в успешной операции. Нажимаем на ссылку "Вернуться на сайт магазина".</td>\r\n<td style="padding: 5px;" align="center" height="65"><a href="images/system/ya3.jpg" title="3. Убеждаемся в успешной операции. Нажимаем на ссылку ''Вернуться на сайт магазина''." rel="173"><img src="images/system/ya3small.jpg" border="0" style="border: 1px solid #000;" /></a></td>\r\n</tr>\r\n<tr>\r\n<td style="padding: 5px;" align="center" height="65">4. Дождитесь загрузки данной страницы, после чего ОБЯЗАТЕЛЬНО нажмите кнопку "Перейти в интернет-магазин". Без этого деньги будут списаны, а аккаунт продлен не будет. <br />Деньги не пропадут, просто придется обратиться к Администратору через <a href="feedback">Обратную связь</a>.</td>\r\n<td style="padding: 5px;" align="center" height="65"><a href="images/system/ya4.jpg" title="4. Дождитесь загрузки данной страницы, после чего ОБЯЗАТЕЛЬНО нажмите кнопку ''Перейти в интернет-магазин''." rel="173"><img src="images/system/ya4small.jpg" border="0" style="border: 1px solid #000;" /></a></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<h3 id="22"><br />Инструкция по оплате PRO-аккаунта через Сбербанк ОнЛ@йн</h3>\r\n<table border="1">\r\n<tbody>\r\n<tr>\r\n<td align="center" bgcolor="#666666" height="35"><span style="color: #ffffff;"><strong>Действия пользователя</strong></span></td>\r\n<td align="center" bgcolor="#666666"><span style="color: #ffffff;"><strong>Картинка (нажми для увеличения)</strong></span></td>\r\n</tr>\r\n<tr>\r\n<td style="padding: 5px;" align="center" height="65">1. Во вкладке "Безналичные" находим иконку "Сбербанк ОнЛ@йн".</td>\r\n<td style="padding: 5px;" align="center" height="65"><a href="images/system/s1.jpg" title="1. Во вкладке ''Безналичные'' находим иконку ''Сбербанк ОнЛ@йн''." rel="176"><img src="images/system/s1small.jpg" border="0" style="border: 1px solid #000;" /></a></td>\r\n</tr>\r\n<tr>\r\n<td style="padding: 5px;" align="center" height="65">2. Следуем всем инструкция на странице. Они написаны очень подробно, с иллюстрациями. После успешной оплаты возвращаемся на вкладку Единой кассы. Обновляем ее до тех пор, пока не будет сообщения о том, что оплата получена.</td>\r\n<td style="padding: 5px;" align="center" height="65"><a href="images/system/s2.jpg" title="2. Следуем всем инструкция на странице. Они написаны очень подробно, с иллюстрациями. После успешной оплаты возвращаемся на вкладку Единой кассы. Обновляем ее до тех пор, пока не будет сообщения о том, что оплата получена." rel="176"><img src="images/system/s2small.jpg" border="0" style="border: 1px solid #000;" /></a></td>\r\n</tr>\r\n<tr>\r\n<td style="padding: 5px;" align="center" height="65">3. Дождитесь загрузки данной страницы, после чего ОБЯЗАТЕЛЬНО нажмите кнопку "Перейти в интернет-магазин". Без этого деньги будут списаны, а аккаунт продлен не будет. <br />Деньги не пропадут, просто придется обратиться к Администратору через <a href="feedback">Обратную связь</a>.</td>\r\n<td style="padding: 5px;" align="center" height="65"><a href="images/system/s3.jpg" title="3. Дождитесь загрузки данной страницы, после чего ОБЯЗАТЕЛЬНО нажмите кнопку ''Перейти в интернет-магазин''." rel="176"><img src="images/system/s3small.jpg" border="0" style="border: 1px solid #000;" /></a></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<h3 id="21"><br />Инструкция по оплате PRO-аккаунта со счета мобильного телефона МТС, Мегафон</h3>\r\n<table border="1">\r\n<tbody>\r\n<tr>\r\n<td align="center" bgcolor="#666666" height="35"><span style="color: #ffffff;"><strong>Действия пользователя</strong></span></td>\r\n<td align="center" bgcolor="#666666"><span style="color: #ffffff;"><strong>Картинка (нажми для увеличения)</strong></span></td>\r\n</tr>\r\n<tr>\r\n<td style="padding: 5px;" align="center" height="65">1. Во вкладке "Мобильные" выбираем своего сотового оператора.</td>\r\n<td style="padding: 5px;" align="center" height="65"><a href="images/system/m1.jpg" title="1. Во вкладке ''Мобильные'' выбираем своего сотового оператора." rel="175"><img src="images/system/m1small.jpg" border="0" style="border: 1px solid #000;" /></a></td>\r\n</tr>\r\n<tr>\r\n<td style="padding: 5px;" align="center" height="65">2. Вводим номер мобильного телефона, нажимаем кнопку "Продолжить".</td>\r\n<td style="padding: 5px;" align="center" height="65"><a href="images/system/m2.jpg" title="2. Вводим номер мобильного телефона, нажимаем кнопку ''Продолжить''." rel="175"><img src="images/system/m2small.jpg" border="0" style="border: 1px solid #000;" /></a></td>\r\n</tr>\r\n<tr>\r\n<td style="padding: 5px;" align="center" height="65">3. На указанный телефонный номер придет смс-сообщение, для подтверждения оплаты отвечаем на него любым текстом (0 для отказа). После этого нажимаем на кнопку "Перейти на страницу статуса".</td>\r\n<td style="padding: 5px;" align="center" height="65"><a href="images/system/m3.jpg" title="3. На указанный телефонный номер придет смс-сообщение, для подтверждения оплаты отвечаем на него любым текстом (0 для отказа). После этого нажимаем на кнопку ''Перейти на страницу статуса''." rel="175"><img src="images/system/m3small.jpg" border="0" style="border: 1px solid #000;" /></a></td>\r\n</tr>\r\n<tr>\r\n<td style="padding: 5px;" align="center" height="65">4. Нажимаем кнопку "Обновить страницу", до тех пор пока не появится сообщение об успешном платеже.</td>\r\n<td style="padding: 5px;" align="center" height="65"><a href="images/system/m4.jpg" title="4. Нажимаем кнопку ''Обновить страницу'', до тех пор пока не появится сообщение об успешном платеже." rel="175"><img src="images/system/m4small.jpg" border="0" style="border: 1px solid #000;" /></a></td>\r\n</tr>\r\n<tr>\r\n<td style="padding: 5px;" align="center" height="65">5. Дождитесь загрузки данной страницы, после чего ОБЯЗАТЕЛЬНО нажмите кнопку "Перейти в интернет-магазин". Без этого деньги будут списаны, а аккаунт продлен не будет. <br />Деньги не пропадут, просто придется обратиться к Администратору через <a href="feedback">Обратную связь</a>.</td>\r\n<td style="padding: 5px;" align="center" height="65"><a href="images/system/m5.jpg" title="5. Дождитесь загрузки данной страницы, после чего ОБЯЗАТЕЛЬНО нажмите кнопку ''Перейти в интернет-магазин''." rel="175"><img src="images/system/m5small.jpg" border="0" style="border: 1px solid #000;" /></a></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<h3 id="20"><br />Инструкция по оплате PRO-аккаунта пластиковыми картами MasterCard, VISA, Maestro</h3>\r\n<table border="1">\r\n<tbody>\r\n<tr>\r\n<td align="center" bgcolor="#666666" height="35"><span style="color: #ffffff;"><strong>Действия пользователя</strong></span></td>\r\n<td align="center" bgcolor="#666666"><span style="color: #ffffff;"><strong>Картинка (нажми для увеличения)</strong></span></td>\r\n</tr>\r\n<tr>\r\n<td style="padding: 5px;" align="center" height="65">1. Во вкладке "Безналичные" выбираем тип карты, которую собираемся использовать (MasterCard/VISA/Maestro).</td>\r\n<td style="padding: 5px;" align="center" height="65"><a href="images/system/visa1.jpg" title="1. Во вкладке ''Безналичные'' выбираем тип карты, которую собираемся использовать (MasterCard/VISA/Maestro)" rel="174"><img src="images/system/visa1small.jpg" border="0" style="border: 1px solid #000;" /></a></td>\r\n</tr>\r\n<tr>\r\n<td style="padding: 5px;" align="center" height="65">2. Вводим данные Вашей пластиковой карты.</td>\r\n<td style="padding: 5px;" align="center" height="65"><a href="images/system/visa2.jpg" title="2. Вводим данные Вашей пластиковой карты." rel="174"><img src="images/system/visa2small.jpg" border="0" style="border: 1px solid #000;" /></a></td>\r\n</tr>\r\n<tr>\r\n<td style="padding: 5px;" align="center" height="65">3. Вводим номер телефона для подтверждения, к которому привязана Ваша карта.</td>\r\n<td style="padding: 5px;" align="center" height="65"><a href="images/system/visa3.jpg" title="3. Вводим номер телефона для подтверждения, к которому привязана Ваша карта." rel="174"><img src="images/system/visa3small.jpg" border="0" style="border: 1px solid #000;" /></a></td>\r\n</tr>\r\n<tr>\r\n<td style="padding: 5px;" align="center" height="65">4. Вводим пароль из СМС.</td>\r\n<td style="padding: 5px;" align="center" height="65"><a href="images/system/visa4.jpg" title="4. Вводим пароль из СМС." rel="174"><img src="images/system/visa4small.jpg" border="0" style="border: 1px solid #000;" /></a></td>\r\n</tr>\r\n<tr>\r\n<td style="padding: 5px;" align="center" height="65">5. Нажимаем кнопку "Оплатить".</td>\r\n<td style="padding: 5px;" align="center" height="65"><a href="images/system/visa5.jpg" title="5. Нажимаем кнопку ''Оплатить''." rel="174"><img src="images/system/visa5small.jpg" border="0" style="border: 1px solid #000;" /></a></td>\r\n</tr>\r\n<tr>\r\n<td style="padding: 5px;" align="center" height="65">6. Вводим пароль, который пришел на телефон, после того, как Вы попали на эту страницу. Нажимаем кнопку "Отправить".</td>\r\n<td style="padding: 5px;" align="center" height="65"><a href="images/system/visa6.jpg" title="6. Вводим пароль, который пришел на телефон, после того, как Вы попали на эту страницу. Нажимаем кнопку ''Отправить''." rel="174"><img src="images/system/visa6small.jpg" border="0" style="border: 1px solid #000;" /></a></td>\r\n</tr>\r\n<tr>\r\n<td style="padding: 5px;" align="center" height="65">7. Убеждаемся в успешной операции. Нажимаем на ссылку "В магазин".</td>\r\n<td style="padding: 5px;" align="center" height="65"><a href="images/system/visa7.jpg" title="7. Убеждаемся в успешной операции. Нажимаем на ссылку ''В магазин''." rel="174"><img src="images/system/visa7small.jpg" border="0" style="border: 1px solid #000;" /></a></td>\r\n</tr>\r\n<tr>\r\n<td style="padding: 5px;" align="center" height="65">8. На сайте Единой кассы нажимаем кнопку "Обновить страницу", до тех пор пока не появится сообщение об успешном платеже.</td>\r\n<td style="padding: 5px;" align="center" height="65"><a href="images/system/visa8.jpg" title="8. На сайте Единой кассы нажимаем кнопку ''Обновить страницу'', до тех пор пока не появится сообщение об успешном платеже." rel="174"><img src="images/system/visa8small.jpg" border="0" style="border: 1px solid #000;" /></a></td>\r\n</tr>\r\n<tr>\r\n<td style="padding: 5px;" align="center" height="65">9. Дождитесь загрузки данной страницы, после чего ОБЯЗАТЕЛЬНО нажмите кнопку "Перейти в интернет-магазин". Без этого деньги будут списаны, а аккаунт продлен не будет. <br />Деньги не пропадут, просто придется обратиться к Администратору через <a href="feedback">Обратную связь</a>.</td>\r\n<td style="padding: 5px;" align="center" height="65"><a href="images/system/visa9.jpg" title="9. Дождитесь загрузки данной страницы, после чего ОБЯЗАТЕЛЬНО нажмите кнопку ''Перейти в интернет-магазин''." rel="174"><img src="images/system/visa9small.jpg" border="0" style="border: 1px solid #000;" /></a></td>\r\n</tr>\r\n</tbody>\r\n</table-->\r\n<h3 id="14"><br />Как мне удалить анкету с сайта?</h3>\r\n<p>С почтового ящика, который был использован Вами при регистрации, отправить письмо с соответствующей просьбой на <a href="mailto:admin@photoso.ru">admin@photoso.ru</a>. В письме указать ссылку на Вашу страницу и данные Вашей учетной записи (логин и пароль) для подтверждения Ваших прав. Неверно оформленные запросы будут игнорироваться.</p>', '', 1, 0, 0, 8, '2012-05-22 12:28:19', 42, '', '2016-10-09 13:11:17', 42, 42, '2016-10-09 14:36:50', '2012-05-22 12:28:19', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 86, 0, 3, '', '', 1, 4778, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(2, 37, 'Рекламодателям', 'reklama-na-sajte', '', '<p><span style="text-decoration: underline;"><strong>Реклама на сайте</strong></span><strong>:</strong></p>\r\n<ul>\r\n<li>На сайте предусмотрено размещение до <strong>четырех</strong> сквозных баннеров размером <strong>468х60</strong>.<br /><br /></li>\r\n<li>Верхние баннеры размещаются над основным меню сайта.</li>\r\n<ul>\r\n<li><strong>1 месяц - 300 рублей.  </strong></li>\r\n<li><strong>2 месяца - 500 рублей. </strong></li>\r\n<li><strong>3 месяца - 700 рублей. </strong></li>\r\n<li><strong>12 месяцев - 1500 рублей. </strong></li>\r\n</ul>\r\n</ul>\r\n<ul>\r\n<li>Нижние баннеры размещаются над подвалом (<em>футером</em>) сайта.</li>\r\n<ul>\r\n<li><strong>1 месяц - 200 рублей.  </strong></li>\r\n<li><strong>2 месяца - 300 рублей. </strong></li>\r\n<li><strong>3 месяца - 500 рублей. </strong></li>\r\n<li><strong>12 месяцев - 1200 рублей. <br /><br /></strong></li>\r\n</ul>\r\n</ul>\r\n<p>Для более детального обсуждения вопросов размещения используйте <a href="feedback" target="_blank">Обратную связь</a> нашего сайта или пишите по адресу: <a href="mailto:admin@photoso.ru">admin@photoso.ru</a>.</p>', '', 1, 0, 0, 8, '2012-05-24 08:28:35', 42, '', '2016-10-23 15:24:20', 42, 0, '0000-00-00 00:00:00', '2012-05-24 08:28:35', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 20, 0, 2, '', '', 1, 934, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', '');
INSERT INTO `a0d19_content` (`id`, `asset_id`, `title`, `alias`, `title_alias`, `introtext`, `fulltext`, `state`, `sectionid`, `mask`, `catid`, `created`, `created_by`, `created_by_alias`, `modified`, `modified_by`, `checked_out`, `checked_out_time`, `publish_up`, `publish_down`, `images`, `urls`, `attribs`, `version`, `parentid`, `ordering`, `metakey`, `metadesc`, `access`, `hits`, `metadata`, `featured`, `language`, `xreference`) VALUES
(3, 38, 'Пользовательское соглашение', 'agreement', '', '<div class="WordSection1">\r\n<p class="MsoNoSpacing"><strong><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">Соглашение</span></strong></p>\r\n<p class="MsoNoSpacing"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;"> </span></p>\r\n<p class="MsoNoSpacing"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">Настоящее Соглашение заключается между интернет-порталом </span><span style="font-family: ''Times New Roman'',''serif''; color: #666666;" lang="EN-US">photoso</span><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">.ru, именуемым в дальнейшем «Исполнитель», и любым лицом, становящимся при регистрации на Сайте пользователем сайта </span><span style="font-family: ''Times New Roman'',''serif''; color: #666666;" lang="EN-US">photoso</span><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">.ru (далее — Сайт), в дальнейшем именуемым Заказчик, вместе по тексту Соглашения именуемые «Стороны», а по отдельности — «Сторона».</span></p>\r\n<p class="MsoNoSpacing"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;"> </span></p>\r\n<p class="MsoNoSpacing"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">В соответствии со статьей 435 Гражданского Кодекса Российской Федерации (ГК РФ), настоящее Пользовательское соглашение признается офертой.</span></p>\r\n<p class="MsoNoSpacing"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;"> </span></p>\r\n<p class="MsoNoSpacing"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">В соответствии со статьей 438 Гражданского Кодекса Российской Федерации (ГК РФ), безусловным принятием (акцептом) условий настоящей оферты Соглашения считается осуществление Заказчиком регистрации на Сайте путем заполнения регистрационной формы и выражения согласия с условиями Соглашения при регистрации.</span></p>\r\n<p class="MsoNoSpacing"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;"> </span></p>\r\n<p class="MsoNoSpacing"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">Настоящее Соглашение, заключаемое путем акцепта настоящей оферты, не требует двустороннего подписания и действительно в электронном виде.</span></p>\r\n<p class="MsoNoSpacing"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;" lang="EN-US"> </span></p>\r\n<p class="MsoNoSpacing"><strong><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">1. Термины и определения, используемые в Соглашении</span></strong></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;"> </span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">В Соглашении, если из текста Соглашения прямо не вытекает иное, следующие слова и выражения будут иметь указанные ниже значения:</span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;"> </span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><strong><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">Сайт</span></strong><span style="font-family: ''Times New Roman'',''serif''; color: #666666;"> — совокупность программных и аппаратных средств для ЭВМ, обеспечивающих публикацию для всеобщего обозрения информации и данных, объединенных общим целевым назначением, посредством технических средств, применяемых для связи между ЭВМ в сети Интернет. Сайт доступен Пользователям по уникальному электронному адресу или его буквенному обозначению. Под Сайтом в Соглашении понимается Сайт Исполнителя, расположенный в сети Интернет по адресу </span><span style="font-family: ''Times New Roman'',''serif''; color: #666666;" lang="EN-US">photoso</span><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">.ru</span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;"> </span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><strong><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">Пользователь</span></strong><span style="font-family: ''Times New Roman'',''serif''; color: #666666;"> — пользователь сети Интернет и в частности Сайта.</span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;"> </span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><strong><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">Заказчик</span></strong><span style="font-family: ''Times New Roman'',''serif''; color: #666666;"> — Пользователь, прошедший процедуру регистрации на Сайте.</span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><strong><span style="font-family: ''Times New Roman'',''serif''; color: #666666;"> </span></strong></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><strong><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">Регистрация</span></strong><span style="font-family: ''Times New Roman'',''serif''; color: #666666;"> — процедура заполнения Пользователем регистрационной формы на Сайте с последующим присвоением Учетной информации.</span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;"> </span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><strong><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">Учетная информация Заказчика</span></strong><span style="font-family: ''Times New Roman'',''serif''; color: #666666;"> — уникальное имя Пользователя (логин) и пароль для входа на Сайт, указываемые Пользователем при регистрации на Сайте.</span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;"> </span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><strong><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">Личный кабинет Заказчика</span></strong><span style="font-family: ''Times New Roman'',''serif''; color: #666666;"> — совокупность защищенных страниц на Cайте, создаваемых при регистрации Заказчика, на которой Заказчик осуществляет выбор и заказ Услуг, перечисление средств в оплату Платных услуг, а также пользуется Бесплатными услугами. Доступ к Личному кабинету осуществляется Заказчиком посредством ввода Учетной информации Заказчика.</span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;"> </span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><strong><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">Лицевой счет Заказчика на Сайте</span></strong><span style="font-family: ''Times New Roman'',''serif''; color: #666666;"> — система учета денежных средств на Сайте по расчетным операциям Сторон, расположенная в Личном кабинете Заказчика.</span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;"> </span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><strong><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">Профиль/аккаунт (Профиль)</span></strong><span style="font-family: ''Times New Roman'',''serif''; color: #666666;"> — личная страница Пользователя на Сайте, доступная всем Пользователям Сайта.</span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;"> </span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><strong><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">PRO-аккаунт</span></strong><span style="font-family: ''Times New Roman'',''serif''; color: #666666;"> - расширенные возможности для стандартного аккаунта. </span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;"> </span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><strong><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">Услуги</span></strong><span style="font-family: ''Times New Roman'',''serif''; color: #666666;"> — Платные и Бесплатные услуги Исполнителя, предоставляемые Исполнителем на условиях Соглашения Заказчику посредством Сайта.</span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;"> </span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><strong><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">Платные услуги</span></strong><span style="font-family: ''Times New Roman'',''serif''; color: #666666;"> — возмездные услуги, предоставляемые Исполнителем на условиях Соглашения Заказчику посредством Сайта.</span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;"> </span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><strong><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">Бесплатные услуги</span></strong><span style="font-family: ''Times New Roman'',''serif''; color: #666666;"> — услуги и возможности, предоставляемые Исполнителем на условиях Соглашения Заказчику посредством Сайта, не требующие оплаты со стороны Заказчика. Все Услуги, прямо не названные на Сайте платными, предоставляются безвозмездно и признаются Бесплатными услугами.</span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;"> </span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><strong><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">Активация Платной услуги</span></strong><span style="font-family: ''Times New Roman'',''serif''; color: #666666;"> — подключение PRO-аккаунта для стандартного Профиля на срок, оплаченный Заказчиком на промо-странице конкретной Платной услуги из Личного кабинета Заказчика.</span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;"> </span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><strong><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">Модерация</span></strong><span style="font-family: ''Times New Roman'',''serif''; color: #666666;"> — просмотр Исполнителем размещаемой (или планируемой к размещению — Премодерация) на Сайте Заказчиком информации на предмет ее соответствия положениям Соглашения и правилам Сайта, а в случаях ее несоответствия им — удаление информации с Сайта без уведомления Заказчика. Модерация не является обязанностью Исполнителя, если на это содержится прямое указание.</span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;" lang="EN-US"> </span></p>\r\n<p class="MsoNoSpacing"><strong><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">2. Предмет соглашения</span></strong></p>\r\n<p class="MsoNoSpacing"><strong><span style="font-family: ''Times New Roman'',''serif''; color: #666666;" lang="EN-US"> </span></strong></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">2.1. Исполнитель обязуется оказывать Услуги Заказчику, а Заказчик обязуется соблюдать условия Соглашения, в том числе, но, не ограничиваясь, оплачивать Платные услуги.</span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;"> </span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">2.2. Исполнитель оказывает Заказчику Услуги путем предоставления доступа к Базе данных, а также путем предоставления иных Бесплатных услуг и Платных услуг.</span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;"> </span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">2.3. Обязательным условием оказания Исполнителем Услуг в соответствии с Соглашением является принятие, соблюдение Заказчиком и применение к отношениям Сторон требований и положений, определенных Соглашением.</span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;"> </span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">2.4. Исполнитель оставляет за собой право изменять условия Соглашения и всех его неотъемлемых частей без согласования с Заказчиком с уведомлением последнего посредством размещения на Сайте новой редакции Соглашения или какой-либо его неотъемлемой части, подвергшейся изменениям. Новая редакция Соглашения и/или какой-либо его неотъемлемой части вступает в силу с момента опубликования на Сайте, если иной срок вступления изменений в силу не определен Исполнителем при их опубликовании. Действующая редакция Соглашения и всех приложений к нему всегда находится на Сайте в публичном доступе по адресу: http://photoso.ru/agreement.</span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;"> </span></p>\r\n<p class="MsoNoSpacing"><strong><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">3. Права и обязанности сторон</span></strong></p>\r\n<p class="MsoNoSpacing"><strong><span style="font-family: ''Times New Roman'',''serif''; color: #666666;"> </span></strong></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">3.1. Права и обязанности Исполнителя</span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;"> </span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 70.8pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">3.1.1. Исполнитель оказывает Заказчику Услуги. Объем, сроки, условия оказания Услуг определяются типом Услуг, приобретаемых Заказчиком или получаемых им безвозмездно (Бесплатные услуги), но в любом случае с учетом того, что возможность или невозможность получить доступ к Базе данных определяется в момент запроса к Базе данных при помощи Сайта. Исполнитель не гарантирует, что информация, доступная в определенный момент времени, будет доступна в любой другой момент времени на протяжении срока действия Соглашения.</span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 70.8pt;"> </p>\r\n<p class="MsoNoSpacing" style="margin-left: 70.8pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">3.1.2. Исполнитель предоставляет Заказчику возможность самостоятельно публиковать информацию о самом Заказчике, информацию об услугах Заказчика, примеры работ Заказчика с соблюдением условий данного Соглашения и правил Сайта.</span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 70.8pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;"> </span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 70.8pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">3.1.3. Содержание Услуг, сроки их предоставления и иные параметры Услуги определяются Заказчиком самостоятельно посредством выбора Услуги и/или Активации Платной услуги в Личном кабинете Заказчика, или на странице, содержащей предложение Платной Услуги (далее — промо-страница Платной услуги).</span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 70.8pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;"> </span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 70.8pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">3.1.4. Исполнитель вправе по своему усмотрению в одностороннем порядке изменять стоимость Платных услуг для каждого конкретного Заказчика, а так же доступные способы оплаты данных Платных услуг. Об изменении стоимости Платных услуг Исполнитель обязан уведомлять Заказчика путем размещения соответствующей информации на Сайте на странице, где данная Платная услуга предлагается к приобретению. При изменении стоимости Платных услуг предоставление уже оплаченных Заказчиком услуг происходит в соответствии с теми тарифами, которые действовали на момент Активации соответствующих Платных услуг.</span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 70.8pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;"> </span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 70.8pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">3.1.5. В случае нарушения Заказчиком условий Соглашения или правил Сайта Исполнитель направляет Заказчику предупреждение, содержащее перечень нарушений. В случае, если Заказчик не устранит нарушения в течение одного дня c момента направления ему уведомления или повторно нарушит указанные условия или иные условия, Исполнитель имеет право в одностороннем порядке отказаться от исполнения Соглашения, заблокировать доступ Пользователей к Профилю Заказчика, аннулировать Личный кабинет Заказчика и удержать с Заказчика штраф в размере неиспользованного остатка денежных средств по Активированным Платным услугам. В случае если такие нарушения причинили ущерб третьим лицам, ответственность за них полностью лежит на Заказчике.</span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 70.8pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;"> </span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 70.8pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">3.1.6. В течение срока действия Соглашения Исполнитель вправе осуществлять Модерацию в случаях, когда информация, размещаемая Заказчиком, пропагандирует ненависть и/или дискриминацию людей по расовому, этническому, половому, религиозному, социальному признакам; пропагандирует употребление наркотических и прочих средств, наносящих вред здоровью; призывает к бесчеловечному обращению с животными; нарушает права национальных и иных меньшинств; содержит призывы к насильственным действиям; нарушает права авторов и иных владельцев интеллектуальных прав.</span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 70.8pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;"> </span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 70.8pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">3.1.7. Исполнитель обязуется не разглашать третьим лицам Учетную информацию Заказчика.</span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 70.8pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;"> </span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 70.8pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">3.1.8. Исполнитель не несет ответственность за информацию, оставленную третьими лицами в модуле Отзывы на персональной странице Заказчика.</span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 70.8pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;"> </span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 70.8pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">3.1.9. Исполнитель в праве удалить без уведомления Профиль Заказчика из Базы данных Сайта в любое время и без объяснения причин. </span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 70.8pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;"> </span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">3.2. Права и обязанности Заказчика</span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;"> </span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 70.8pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">3.2.1. Заказчик обязуется использовать персональные данные, размещенные в Базе данных Сайта в соответствии с Федеральным Законом «О персональных данных» № 152-ФЗ от 27 июля 2006 г. и всеми вносимыми в него изменениями в течение срока действия Соглашения</span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 70.8pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;"> </span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 70.8pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">3.2.2. Заказчику запрещается передавать свою Учетную информацию третьим лицам.</span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 70.8pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;"> </span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 70.8pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">3.2.3. Заказчик имеет право самостоятельно изменять пароль, не уведомляя об этом Исполнителя.</span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 70.8pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;"> </span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 70.8pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">3.2.4. Заказчик имеет право внести денежную сумму, используя любой тариф по своему усмотрению с целью последующей Активации Платных услуг. Информация о стоимости Платных услуг Исполнителя содержится на промо-странице конкретной Платной услуги.</span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 70.8pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;"> </span></p>\r\n<p class="MsoNoSpacing"><strong><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">4. Персональные данные</span></strong></p>\r\n<p class="MsoNoSpacing"><strong><span style="font-family: ''Times New Roman'',''serif''; color: #666666;" lang="EN-US"> </span></strong></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">4.1. Информация о Заказчике, расположенная в его Профиле, содержит (может содержать) его персональные данные. При этом такие персональные данные Заказчика являются общедоступными, и любой Пользователь Сайта может ознакомиться с ними.</span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;"> </span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">4.2. Учитывая, что персональные данные с согласия Заказчика являются общедоступными, тем не менее, Исполнитель при обработке персональных данных Заказчиков обязуется принять все организационные и технические меры для их защиты от несанкционированного доступа способом, не предусмотренным Сайтом.</span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;"> </span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">4.3. Однако не исключено, что в результате сбоя в работе Сайта, вирусной или хакерской атаки, технических неисправностей и иных обстоятельств персональные данные Заказчика могут стать доступными и другим лицам. Заказчик это понимает и соглашается с тем, что не будет предъявлять претензии к Исполнителю в связи с этим, учитывая, что он делает свои персональные данные общедоступными.</span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;"> </span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">4.4. В силу настоящего Соглашения, указывая свои персональные данные на Сайте, Заказчик безусловно соглашается:</span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">— с предоставлением персональных данных неограниченному кругу лиц при помощи Сайта;</span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">— с обработкой персональных данных Исполнителем;</span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">— с распространением персональных данных при помощи Сайта;</span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">— с иными действиями Исполнителя в отношении таких данных в связи с функционированием Сайта.</span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;"> </span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">4.5. Размещая на Сайте свои персональные данные, Заказчик подтверждает, что делает это добровольно, а также что он добровольно предоставляет их Исполнителю для обработки. Если Заказчик не согласен с вышеуказанными условиями, то он не должен регистрироваться на Сайте или должен немедленно отправить через Обратную связь электронное письмо с просьбой удалить свой Профиль и использовать Сайт исключительно как Пользователь.</span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;"> </span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">4.6. Исполнитель обрабатывает только те персональные данные Заказчика, которые были размещены им на Сайте. Персональные данные Заказчика обрабатываются с помощью программно-аппаратных и технических средств Сайта.</span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;"> </span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">4.7. Целью обработки персональных данных Заказчиков является составление Базы данных Заказчиков Сайта для обеспечения функционирования Сайта и последующего предоставления Услуг Заказчику Исполнителем.</span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;"> </span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">4.8. Персональные данные Заказчика обрабатываются Исполнителем в течение срока их размещения на Сайте. Если персональные данные, размещенные на Сайте или в Профиле Заказчика, будут удалены, то Исполнитель прекращает их обработку. Однако Исполнитель имеет право сохранить резервную копию вышеуказанных данных Заказчика до ликвидации Исполнителя.</span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;"> </span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">4.9. Обработка Исполнителем персональных данных Заказчика осуществляется в целях функционирования Сайта и сама по себе их обработка Сайтом не может повлечь каких-либо негативных последствий для Заказчика. При этом Исполнитель не несет ответственности за использование персональных данных Заказчика другими лицами.</span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;"> </span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">4.10. Заказчик обязуется не размещать на Сайте персональные данные других лиц, а также не использовать персональные данные других Заказчиков или Пользователей каким-либо образом, не соответствующим требованиям законодательства РФ, в противоправных или противозаконных целях, в целях извлечения выгоды и любых иных целях, не соответствующих целям создания Сайта.</span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;" lang="EN-US"> </span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">4.11. Исполнитель имеет право сохранить архивную копию и без ущерба для иных положений Соглашения без согласия Заказчика передать данные о Заказчике:</span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">— государственным органам, в том числе органам дознания и следствия, и органам местного самоуправления по их мотивированному запросу;</span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">— на основании судебного акта;</span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">— третьим лицам по их мотивированному письменному запросу в случае нарушения или предполагаемого нарушения их прав;</span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">— в иных предусмотренных действующим законодательством РФ случаях.</span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;"> </span></p>\r\n<p class="MsoNoSpacing"><strong><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">5. Порядок оказания Услуг</span></strong></p>\r\n<p class="MsoNoSpacing"><strong><span style="font-family: ''Times New Roman'',''serif''; color: #666666;"> </span></strong></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">5.1. В целях пользования Услугами, предоставляемыми Исполнителем по Соглашению посредством Сайта, Заказчик должен пройти обязательную процедуру регистрации Заказчика на Сайте.</span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;"> </span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">5.2. По завершении процесса регистрации Заказчик становится обладателем Учетной информации Заказчика, что означает, что он несет ответственность за безопасность Учетной информации, а также за все, что будет сделано на Сайте под Учетной информацией Заказчика. Заказчик обязан немедленно уведомить Исполнителя о любом случае несанкционированного доступа к Сайту, то есть осуществленного третьим лицом без согласия и ведома Заказчика, 