ily: ''Times New Roman'',''serif''; color: #666666;"> </span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">7.2. Интеллектуальная собственность Заказчика и третьих лиц</span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;"> </span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 70.8pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">7.2.1. Заказчик самостоятельно несет ответственность в связи с использованием прав на объекты интеллектуальной собственности, содержащиеся в размещаемых Заказчиком на Сайте материалах, а также в материалах, передаваемых Заказчиком посредством Сайта, хранящиеся на Сайте в Личном кабинете Заказчика или материалы, каким-либо иным способом становящиеся доступными с помощью или посредством Сайта вследствие действий и/или бездействия Заказчика.</span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 70.8pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;"> </span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 70.8pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">7.2.2. Заказчик гарантирует урегулирование всех возможных претензий правообладателей и/или авторов и/или исполнителей или иных третьих лиц к Исполнителю, связанных с материалами, указанными в п. 7.2.1 Соглашения, своими силами и за свой счет. В случае предъявления Исполнителю претензий, исков, требований третьими лицами по вопросу незаконного использования Заказчиком на Сайте объектов интеллектуальной собственности, Заказчик обязуется возместить Исполнителю все убытки, которые последний понес в результате такого нарушения или предъявления таких претензий, а Исполнитель вправе расторгнуть Соглашение в одностороннем порядке, осуществив удаление Профиля Заказчика из Базы данных.</span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 70.8pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;"> </span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 70.8pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">7.2.3. Принимая во внимание, что Сайт является общедоступным для Пользователей, а Исполнитель не гарантирует, что размещаемые или предоставляемые Пользователями на Сайте материалы являются свободными от требований третьих лиц, в случае, если Пользователь или Заказчик является правообладателем (или его правопреемником) на объекты интеллектуальной собственности, размещенные на Сайте, и его права тем или иным образом нарушаются с использованием Сайта, применяется следующая схема урегулирования претензий третьих лиц:</span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 106.2pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">— в адрес Исполнителя по электронной почте на адрес </span><span style="font-family: ''Times New Roman'',''serif''; color: #666666;" lang="EN-US">admin</span><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">@</span><span style="font-family: ''Times New Roman'',''serif''; color: #666666;" lang="EN-US">photoso</span><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">.</span><span style="font-family: ''Times New Roman'',''serif''; color: #666666;" lang="EN-US">ru</span><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">направляется претензия, содержащая информацию об объекте интеллектуальной собственности, права на который принадлежат заявителю и который используется незаконно посредством Сайта, с приложением документов, подтверждающих правомочия заявителя, данные о правообладателе и копия доверенности на действия от лица правообладателя, если лицо, направляющее претензию, не является руководителем компании правообладателя или непосредственно физическим лицом — правообладателем. В претензии так же указывается адрес страницы Сайта, которая содержит данные, нарушающие права, и излагается полное описание сути нарушения прав (почему распространение данной информации запрещено правообладателем);</span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 106.2pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">— Исполнитель обязуется рассмотреть надлежаще оформленную претензию в течение 5 (пяти) рабочих дней с даты ее получения и уведомить заявителя о результатах ее рассмотрения. В том числе, Исполнитель вправе запросить дополнительные документы, свидетельства, данные, подтверждающие законность предъявляемой претензии. В случае признания претензии правомерной, Исполнитель примет все возможные меры, необходимые для прекращения нарушения прав заявителя.</span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 106.2pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">— при этом Пользователь и/или Заказчик, предъявляя претензию в адрес Исполнителя, заявляет и гарантирует, что в случае возникновения претензий к Исполнителю со стороны третьих лиц (других Пользователей и/или Заказчиков), связанных с нарушением их прав (в том числе потребительских прав) в отношении удаленной/блокированной информации и/или данных, заявитель принимает все необходимые меры по урегулированию претензий, а также возможных споров, в том числе судебных, а также, в случае возникновения у Исполнителя убытков, возместит их в полном объеме.</span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 106.2pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;"> </span></p>\r\n<p class="MsoNoSpacing"><strong><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">8. Ответственность Сторон</span></strong></p>\r\n<p class="MsoNoSpacing"><strong><span style="font-family: ''Times New Roman'',''serif''; color: #666666;"> </span></strong></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">8.1. Заказчик самостоятельно определяет перечень организационных и программных (для ЭВМ) средств для сохранения в тайне своей Учетной информации и обеспечения санкционированного доступа к ней. Исполнитель не несет ответственность за убытки, причиненные Заказчику в результате разглашения третьим лицам Учетной информации Заказчика, произошедшего не по вине Исполнителя. Если любое лицо помимо Заказчика авторизуется на Сайте, используя Учетную информацию Заказчика, то все действия, совершенные таким лицом, будут считаться совершенными этим Заказчиком. Заказчик самостоятельно несет ответственность за все действия, совершенные им на Сайте, а также за все действия, совершенные на Сайте любыми иными лицами с использованием Учетной информации Заказчика.</span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;"> </span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">8.2. Исполнитель, с применением имеющихся программных средств на Сайте, обеспечивает Заказчику практическую возможность самостоятельного изменения пароля без предварительных уведомлений Исполнителя.</span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;"> </span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">8.3. Исполнитель не гарантирует, что программное обеспечение Cайта не содержит ошибок и/или компьютерных вирусов или посторонних фрагментов кода. Исполнитель предоставляет возможность Заказчику пользоваться программным обеспечением Сайта «как оно есть», без каких-либо гарантий со стороны Исполнителя.</span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;"> </span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">8.4. Исполнитель не несет ответственности за убытки, причиненные Заказчику в результате сообщения другим Заказчиком недостоверной информации, а также причиненные действиями (бездействием) другого Заказчика. Исполнитель не гарантирует, что информация, содержащаяся в Профилях Заказчиков, является достоверной и полной.</span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;"> </span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">8.5. В случае досрочного расторжения Соглашения по инициативе Заказчика, выраженной в письменном виде, Исполнитель оставляет денежные средства, уплаченные Заказчиком Исполнителю по Соглашению.</span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;"> </span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">8.6. За нарушение прочих обязательств по Соглашению Стороны несут ответственность в соответствии с действующим законодательством РФ. При этом в любом случае ответственность Исполнителя перед Заказчиком в случае требования возмещения убытков ограничена размером стоимости оплаченных Заказчиком Платных услуг.</span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;"> </span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">8.7. Исполнитель прилагает все возможные усилия для обеспечения нормальной работоспособности Сайта, однако не несет ответственности за неисполнение или ненадлежащее исполнение обязательств по Соглашению, а также возможные убытки, возникшие в том числе, но, не ограничиваясь, в результате:</span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;"> </span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 70.8pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">8.7.1. Неправомерных действий Пользователей и/или Заказчиков, направленных на нарушения информационной безопасности или нормального функционирования Сайта;</span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 70.8pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;"> </span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 70.8pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">8.7.2. Сбоев в работе Сайта, вызванных ошибками в коде, компьютерными вирусами и иными посторонними фрагментами кода в программном обеспечении Сайта;</span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 70.8pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;"> </span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 70.8pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">8.7.3. Отсутствия (невозможности установления, прекращения и пр.) Интернет-соединений между сервером Заказчика и сервером Сайта;</span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 70.8pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;"> </span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 70.8pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">8.7.4. Проведения государственными и муниципальными органами, а также иными организациями мероприятий в рамках Системы оперативно-розыскных мероприятий;</span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 70.8pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;"> </span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 70.8pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">8.7.5. Установления государственного регулирования (или регулирования иными организациями) хозяйственной деятельности коммерческих организаций в сети Интернет и/или установления указанными субъектами разовых ограничений, затрудняющих или делающих невозможным исполнение Соглашения;</span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 70.8pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;"> </span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 70.8pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">8.7.6. Других случаев, связанных с действиями (бездействием) Пользователей и/или других субъектов, направленными на ухудшение общей ситуации с использованием сети Интернет и/или компьютерного оборудования, существовавшей на момент заключения Соглашения, также любых других действий, направленных на Сайт и на третьих лиц; </span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 70.8pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;"> </span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 70.8pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">8.7.7. Выполнения работ, указанных в п. 8.8 и п. 8.9 Соглашения.</span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 70.8pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;"> </span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">8.8. Исполнитель имеет право производить профилактические работы в программно-аппаратном комплексе Сайта с временным приостановлением работы Сайта по возможности в ночное время и максимально сокращая время неработоспособности Сайта, не уведомляя об этом Заказчика.</span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;"> </span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">8.9. В случае наступления форс-мажорных обстоятельств, а также аварий или сбоев в программно-аппаратных комплексах третьих лиц, сотрудничающих с Исполнителем, или действий (бездействий) третьих лиц, направленных на приостановку или прекращение функционирования Сайта, возможна приостановка работы Сайта без предварительного уведомления Заказчика.</span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;"> </span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">8.10. Ни одна из Сторон не несет ответственности за полное или частичное неисполнение любой из своих обязанностей, если неисполнение является следствием таких обстоятельств, как наводнение, пожар, землетрясение, другие стихийные бедствия, война или военные действия и другие обстоятельства непреодолимой силы, возникшие после заключения Соглашения и независящие от воли Сторон.</span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;"> </span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">8.11. В случае действия обстоятельств непреодолимой силы более 3 (трех) месяцев любая Сторона вправе в одностороннем порядке отказаться от исполнения своих обязательств по Соглашению (расторгнуть Соглашение).</span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;"> </span></p>\r\n<p class="MsoNoSpacing"><strong><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">9. Порядок разрешения споров и урегулирования претензий</span></strong></p>\r\n<p class="MsoNoSpacing"><strong><span style="font-family: ''Times New Roman'',''serif''; color: #666666;"> </span></strong></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">9.1. В случае возникновения споров между Заказчиком и Исполнителем по вопросам, связанным с исполнением Соглашения, Стороны примут все меры к разрешению их путем переговоров между собой. Претензионный порядок разрешения споров обязателен. Претензии Заказчиков по предоставляемым Услугам принимаются и рассматриваются Исполнителем только в письменном виде и в порядке, предусмотренном настоящим Соглашением и действующим законодательством РФ.</span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;"> </span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">9.2. Для разрешения споров, возникших между Заказчиком и Исполнителем в результате использования Услуг, применяется следующий претензионный порядок:</span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;"> </span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 70.8pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">— заказчик, считающий, что его права нарушены из-за действий Исполнителя, направляет последнему по электронной почте на адрес </span><span style="font-family: ''Times New Roman'',''serif''; color: #666666;" lang="EN-US">admin</span><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">@</span><span style="font-family: ''Times New Roman'',''serif''; color: #666666;" lang="EN-US">photoso</span><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">.</span><span style="font-family: ''Times New Roman'',''serif''; color: #666666;" lang="EN-US">ru</span><span style="font-family: ''Times New Roman'',''serif''; color: #666666;"> претензию, содержащую суть предъявляемого требования, обоснование его предъявления, а также все данные Заказчика. Претензия также направляется Исполнителю в письменном виде посредством отправки по почте или с курьером;</span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 70.8pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;"> </span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 70.8pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">— в течение 5 (пяти) рабочих дней со дня получения претензии Исполнитель обязан изложить свою позицию по указанным в ней принципиальным вопросам и направить свой ответ по адресу электронной почты и почтовому адресу, указанному в претензии Заказчиком;</span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 70.8pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;"> </span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 70.8pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">— в случае недостижения разрешения спора путем претензионного порядка спор подлежит рассмотрению в соответствии с п. 9.4 Соглашения;</span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 70.8pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;"> </span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 70.8pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">— исполнителем не рассматриваются анонимные претензии или претензии, не позволяющие идентифицировать Заказчика на основе предоставленных им при регистрации данных, или претензии, не содержащие данных, указанных в настоящем пункте настоящего Соглашения.</span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 70.8pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;"> </span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">9.3. Для решения технических вопросов при определении вины Заказчика в результате его неправомерных действий при пользовании сетью Интернет и Сайтом в частности, Исполнитель вправе самостоятельно привлекать компетентные организации в качестве экспертов. В случае установления вины Заказчика, последний обязан возместить затраты на проведение экспертизы.</span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;"> </span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">9.4. При недостижении согласия между Cторонами путем переговоров, спор, вытекающий из настоящего Соглашения, подлежит рассмотрению в Арбитражном суде (если Заказчиком является юридическое лицо), либо в суде общей юрисдикции по месту нахождения Исполнителя (если Заказчиком является физическое лицо).</span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;"> </span></p>\r\n<p class="MsoNoSpacing"><strong><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">10. Вступление соглашения в силу и действие</span></strong></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><strong><span style="font-family: ''Times New Roman'',''serif''; color: #666666;"> </span></strong></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">10.1. Соглашение вступает в силу с момента акцепта настоящей оферты Заказчиком. Безусловным принятием (акцептом) условий настоящей оферты Соглашения считается осуществление Заказчиком регистрации на Сайте. Безусловным принятием (акцептом) всех условий предоставления Платных услуг также считается осуществление Заказчиком платежа в счет оплаты Платной услуги.</span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;"> </span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">10.2. Соглашение заключается на неопределенный срок и может быть расторгнуто по инициативе любой из Сторон в любое время. Для этого Исполнитель размещает уведомление о расторжении Соглашения на Сайте и/или направляет Заказчику на его Профиль соответствующее уведомление, с момента такого размещения/направления такого уведомления Соглашение считается расторгнутым. Заказчик может расторгнуть Соглашение путем отправки электронного письма по адресу </span><span style="font-family: ''Times New Roman'',''serif''; color: #666666;" lang="EN-US">admin</span><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">@</span><span style="font-family: ''Times New Roman'',''serif''; color: #666666;" lang="EN-US">photoso</span><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">.</span><span style="font-family: ''Times New Roman'',''serif''; color: #666666;" lang="EN-US">ru</span><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">с почтового ящика, который был использован при регистрации Аккаунта, с просьбой удалить свой Профиль с Сайта, предварительно добавив в текст письма свои логин и пароль для подтверждения своих прав на данный Профиль</span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">.</span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">10.3. Настоящее Соглашение распространяет свое действие на Заказчиков, осуществивших регистрацию до даты опубликования настоящего Соглашения на Сайте.</span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;"> </span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">10.4. Заказчик обязуется самостоятельно знакомиться с условиями Соглашения. Если Заказчик не согласен с условиями настоящего Соглашения, то он должен немедленно отправить через Обратную связь электронное письмо с просьбой удалить свой Профиль, в противном случае продолжение использования Заказчиком Сайта означает, что Заказчик согласен с условиями Соглашения.</span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;"> </span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">10.5. При определении сроков определение времени совершения Стороной или третьими лицами действия (бездействия) исчисляется по Московскому времени.</span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;"> </span></p>\r\n<p class="MsoNoSpacing"><strong><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">11. Прочие условия</span></strong></p>\r\n<p class="MsoNoSpacing"><strong><span style="font-family: ''Times New Roman'',''serif''; color: #666666;"> </span></strong></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">11.1. Стороны договорились, что при исполнении (изменении, дополнении, прекращении) Соглашения допускается использование подписей представителей Сторон, а также их печатей, с помощью средств факсимильной связи, механического или иного копирования, электронно-цифровой подписи либо иного аналога собственноручной подписи руководителей и печатей организаций. Стороны подтверждают, что документы к Соглашению, подписанные и оформленные указанным в настоящем пункте способом, имеют юридическую силу и обязательны для исполнения Сторонами.</span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;"> </span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">11.2. Стороны признают любую информацию, касающуюся заключения Соглашения, включая любые приложения и дополнения к нему, коммерческой тайной и обязуются строго сохранять конфиденциальный характер такой информации, не разглашая ее третьим лицам без предварительного письменного на то согласия другой Стороны, за исключением случаев, когда это необходимо для целей Соглашения или для раскрытия соответствующим государственным органам в случаях, определенных законом. Указанное положение не относится к общеизвестной или общедоступной информации. Стороны считают конфиденциальной всю деловую информацию, передаваемую друг другу, как-то: информация об их клиентах, партнерах, бизнес — планах, ценах, финансовом состоянии и т.д. Стороны не должны открывать такую информацию кому бы то ни было, за исключением случаев, когда это необходимо для надлежащего выполнения их обязательств по Соглашению, или если такая информация является общедоступной, или по взаимному согласованию Сторон.</span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;"> </span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">11.3. Любые уведомления, запросы или иные сообщения (корреспонденция), представляемые Сторонами друг другу должны быть оформлены в письменном виде и направлены получающей Стороне по почте, путем направления заказной корреспонденции, по электронной почте, факсу или с курьером, как будет сочтено целесообразным. Датой получения корреспонденции считается момент получения почтового отправления, в том числе заказной корреспонденции, электронного подтверждения доставки при отправлении электронной почтой или по факсу, или день доставки в случае отправления корреспонденции с курьером. При рассмотрении споров в суде переписка Сторон по электронной почте, факсимильные сообщения будут признаны Сторонами достаточными доказательствами, если настоящим Соглашением прямо не предусмотрен иной способ направления корреспонденции.</span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">Адрес электронной почты: </span><span style="font-family: ''Times New Roman'',''serif''; color: #666666;" lang="EN-US">admin</span><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">@</span><span style="font-family: ''Times New Roman'',''serif''; color: #666666;" lang="EN-US">photoso</span><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">.</span><span style="font-family: ''Times New Roman'',''serif''; color: #666666;" lang="EN-US">ru</span><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">.</span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;"> </span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">11.</span><span style="font-family: ''Times New Roman'',''serif''; color: #666666;" lang="EN-US">4</span><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">. С даты вступления в силу настоящего Соглашения прекращаются любые соглашения по предмету настоящего Соглашения или аналогичные ему (включая предшествующую заключению настоящего Соглашения переписку по его предмету), имеющие место между Сторонами.</span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;"> </span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">11.</span><span style="font-family: ''Times New Roman'',''serif''; color: #666666;" lang="EN-US">5</span><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">. Некоторые Платные услуги, предоставляемые Исполнителем, могут регулироваться отдельными соглашениями (договорами), заключаемыми между Исполнителем и Заказчиком и размещаемыми на Сайте в непосредственной близости от такой предлагаемой Платной услуги. В случае расхождения между текстом настоящего Соглашения и соглашения (договора) на отдельную Платную услугу, преимущественную силу при определении правоотношений между Исполнителем и Заказчиком при приобретении Платной услуги, регулируемой отдельным соглашением (договором), имеют положения заключаемого между Исполнителем и Заказчиком соглашения (договора) на конкретную Платную услугу.</span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;"> </span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">11.</span><span style="font-family: ''Times New Roman'',''serif''; color: #666666;" lang="EN-US">6</span><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">. В случае, если какое-либо из положений Соглашения окажется недействительным в силу закона, оно будет считаться исключенным из Соглашения, а остальные положения Соглашения сохранят силу.</span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;"> </span></p>\r\n<p class="MsoNoSpacing" style="margin-left: 35.4pt;"><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">11</span><span style="font-family: ''Times New Roman'',''serif''; color: #666666;" lang="EN-US">.7</span><span style="font-family: ''Times New Roman'',''serif''; color: #666666;">. Вопросы, неурегулированные Соглашением и документами, указанными в п.2.3 Соглашения, подлежат разрешению в соответствии с законодательством РФ.</span></p>\r\n</div>', '', 1, 0, 0, 8, '2012-05-24 08:29:26', 42, '', '2014-11-29 16:18:56', 42, 42, '2015-07-07 14:48:28', '2012-05-24 08:29:26', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 14, 0, 1, '', '', 1, 560, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', '');
