(92, 'Текст в шапке сайта', '', '<p>Со страниц нашего сайта Вас приветствуют лучшие фотографы Сочи. В предложенных портфолио Вы всегда легко сможете выбрать понравившихся мастеров, способных предложить Вам любую высококачественную тематическую съемку. Итогом работы будут предоставленный Вам качественно отснятый и оформленный материал.</p>', 1, 'header_info', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 0, '{"prepare_content":"1","backgroundimage":"","layout":"_:default","moduleclass_sfx":"","cache":"1","cache_time":"900","cachemode":"static"}', 0, '*'),
