(75, 'Друзья! С удовольствием объявляю старт розыгрыша!', '<p><img src="https://instagram.fhel2-1.fna.fbcdn.net/t51.2885-15/s640x640/sh0.08/e35/23733887_160091454597950_6074267488185483264_n.jpg" alt="23733887_160091454597950_607426748818548" /></p>\n\n<p>', 86, '2017-12-07 20:27:49', 1),
(76, 'Предметная съёмка часов.', '<p>Предметная съёмка в начале была для меня в новинку, но сейчас уже обыденное занятие. Установка в света и объекта в кадре. Вот один из бекстейджей.<img src="https://pp.userapi.com/c824410/v824410025/8fee8/guibIAIq8SY.jpg" style="width:400px;height:399px;" alt="guibIAIq8SY.jpg" /></p>\n\n<p>Сложная съёмка с применением техники "Стекинг" <br />\nВо время макросъёмки, глубина резкости может быть настолько малой, что не удаётся получать достаточную часть объекта в фокусе. Даже с закрытой диафрагмой макросъёмка существенно ограничивает глубину резкости. Сегодня мы рассмотрим сочетание фотосъёмки со специальной техникой Фотошопа для повышения глубины резкости сверх того, что можно получить в единичной фотографии.<br /><img src="https://pp.userapi.com/c841034/v841034025/61175/3uJ-ihQEBcY.jpg" style="width:500px;height:334px;" alt="3uJ-ihQEBcY.jpg" /></p>\n\n<p>Результат</p>', 10, '2018-01-18 15:56:54', 1),
