(1, 'https://pp.userapi.com/c631320/v631320475/4c5c/frK30Yx-5UM.jpg', 'Ливия Гочу', '231410475', 'Спасибо тебе за чудесную, незабываемую фотосессию! Ангелиночка! Ты просто волшебница и мастер своего дела! Все мои близкие в восторге были от фотографий!нас ещё столько ждёт фотосессий', 75, 1, '2017-03-14 11:54:48', '95.153.128.24'),
(2, 'https://pp.userapi.com/c637221/v637221761/40325/ZHdzf2ssnKM.jpg', 'Оля Каратаева', '223290761', 'Ангелиночка,ты профессионал в своем деле.Работать с тобой одно удовольствие,всегда подскажешь как встать и что делать.Обработка твоих фото высший класс! Я всегда остаюсь довольна твоей фотосессией и фотографиями,которые получаю в итоге', 75, 1, '2017-03-14 13:18:47', '95.153.133.104'),
(3, 'https://pp.userapi.com/c636422/v636422992/5fd0b/CXVI7k3KMkg.jpg', 'Алина Петренко', '28344992', 'Ангелина, ты умница! Знаю, что ты в каждую фотографию вкладываешь столько усилий и труда, ведь получается такая красота', 75, 1, '2017-03-14 14:12:29', '188.162.132.89'),
(4, 'https://pp.userapi.com/c626525/v626525029/53dd7/88_uSCC21Fk.jpg', 'Лена Голенкова', '10835029', 'Ангелина,спасибо за проведенную фотосессию!!! Она прошла не заметно на позитиве! Ты умничка, качественно обрабатываешь фотографии и не заставляешь долго ждать! Я довольно результатом, увидела себя с другой стороны!', 75, 1, '2017-03-15 07:49:46', '95.153.128.205'),
(5, 'https://pp.userapi.com/c636916/v636916068/6a01b/Szvmb3Ph-go.jpg', 'Dina Dina', '365973068', 'Несмотря на изобилие фотографов в Сочи,очень сложно найти профессионала-фотографии ,которого вдохновляют.Ангелина -профессионал, у которого крепкая база образования,  и огромное желание совершенствоваться.Фотографии по цвету и качеству превзошли все мои ожидания.А кропотливость и итотвественность убедили в мастерстве это девушки.Цены на фотосессии более чем приемлемые ЗА ТАКОЕ ПРОФЕССИОНАЛЬНОЕ КАЧЕСТВО  просто подарочные! Уверенна ,Ангелина достигнет больших высот.Всем всем всем рекомендую !!!!!', 75, 1, '2017-03-15 08:38:22', '62.183.127.70'),
(6, 'https://pp.userapi.com/c637424/v637424676/2cba1/JolNSW0He7E.jpg', 'Инна Аухатова', '33966676', 'Ангелина очень ответственная, это сейчас важно. Как фотограф, делает свою работу хорошо . Подсказывает, если нужно . Фотографии подучила быстро, это очень порадовало. Качество просто на высоте. Спасибо', 75, 1, '2017-03-15 10:54:51', '95.153.132.121'),
(7, 'https://pp.userapi.com/c837728/v837728048/22d40/_ao1vQh_coU.jpg', 'Алла Чутелева', '20946048', 'Спасибо Ангелиночка! Фотографии не реально крутые! Безусловно ты лучший фотограф в Сочи! Я в восторге от проделанной работы, сколько труда и усидчивости понадобилось для обработки. В итоге идеальное love story для меня и моего мужа! Ты умничка! Так держать!', 75, 1, '2017-03-15 10:55:11', '85.91.214.176'),
(8, 'https://pp.userapi.com/c626625/v626625000/5cbf5/5wUir-fJBUA.jpg', 'Елена Литаш', '17962000', 'Я просто в восторге от Ангелины и работы с ней!! Она быстро располагает к себе и очень точно подсказывает, какую позу принять, чтобы было красивее, куда смотреть, и т.д. И, результат ее работы просто потрясающий! Она смогла показать меня такой, какой я вижу себя сама. Думаю, для фотографа это решающее качество! Спасибо, Ангелина :)))', 75, 1, '2017-03-16 17:59:16', '176.59.68.191'),
(9, 'https://pp.userapi.com/c841337/v841337966/6abc/F0GbRAL0-rs.jpg', 'Светлана Яковлева', '8686966', 'Очень классные фотки! Огромное спасибо за интересные и разноплановые фотосессии!Места подбираешь очень красивые и живописные. Привезли до красивых мест на своем авто, что тоже большой +. \r\nВсе в восторге!Буду рекомендовать друзьям и знакомым.', 87, 1, '2017-07-30 17:23:23', '37.147.219.126'),
(10, 'https://pp.userapi.com/c631925/v631925241/4bf89/Is0aDDs7vL4.jpg?ava=1', 'Яна Иванова', '8656241', 'Анастасия - фотограф, который не выполняет свои обещания и делает свою работу откровенно плохо. опустим то, что было обещано прислать несколько фотографий до основного результата, не прислала. А когда прислала результат он был не просто разочаровывающим, фотографии выбраны ужасно, из 70 переданных нам фотографий только 5 кадров можно назвать условно неплохими. второй момент - цветокоррекция, из нас белых (даже не загорелых), Анастасия решила сделать мулатов. фотографии летом в Сочи на пляже у моря получились коричнево-серыми. после того как я попросила переделать или хотя бы прислать исходники, чтобы переделать ретушь самостоятельно, фотограф заявила что исходники не передаются. потом через несколько этапов переговоров прислала-таки исходники в формате jpeg (всем нужен формат raw для ретуши). вот такой "профессионализм". деньги заплачены, дальше фотограф не заинтересован сделать свою работу качественно. никому не рекомендую!', 4, 0, '2018-11-13 10:59:46', '185.253.148.11');
