(42, 'IrinaLyutova', '4bf20e641e448d098294ed3813d02922', '', 'Лютова', 'f', 'Ирина', '', 'images/avatars/3030a101c1d4724770599fea28853e8e.jpg', 121, '1996-02-19', 2, 0, 1, '', '0', 'Художественный взгляд на визуальное искусство помогает мне легко находить красивые композиции в кадре, грамотно делать цветокорекцию. \r\nОчень теплая, уютная атмосфера работы​ позволит вам раскрыть себя на съемках, что добавит чувственности и милости готовому материалу. \r\nЯ обладаю весомым опытом во владении различными программами для обработки, такими как Sony Vegas и Adobe After Effects. \r\nНе стоит удивляться коротким срокам монтажа по сравнению с другими предложениями, я люблю процесс работы с материалом и отношусь к этой стадии создания фильма очень трепетно и терпеливо, уделяя работе все свое время.\r\nЯ всегда приветствую ваши предложения по съемке и монтажу. Заранее обсуждается стилистика и маршрут мероприятия, степень освещенности помещений, где будет проводится видеосъемка.\r\nПо Вашему желанию возможна съемка покупки платья и костюма, предложение руки и сердца, мальчишника, девичника и т.д. Стоимость в каждом случае индивидуальна и обсуждается.\r\nТакже проводятся съемки самых разнообразных мероприятий, таких как выписка из роддома, крестины, дни рождения, корпоративы, последний звонок, выпускные вечера, флешмобы, промо акции и т.д. Детали съемок и цена обговариваются по телефону и при последующей личной встрече.', 'Erin_Brandywine@bk.ru', '89181001068', 'Erin_Brandywine@bk.ru', 'vk.com/erinjane', 'vk.com/irinalyutovaclub', '', 'https://www.facebook.com/erin.lyutova', '', '', '', NULL, 'Ира Лютова', '2017-02-13', '', '2017-02-18', 1, '2017-02-13', 1, 1, 0),
(43, 'aljoh.rostov@mail.ru', 'a1b8c42f198e80bdcef9710d49d96672', '', 'Алексей', 'm', 'Варшавский', '', 'images/avatars/12d8d457de0e6f35ed59d98f05d3d859.jpg', 127, '1976-09-11', 2, 0, 1, '', '0', 'СТИЛЬНАЯ СВАДЕБНАЯ ВИДЕОСЪЁМКА и  Love Story (истории любви) \r\nПРЕМИУМ класса от видеостудии Алексея Варшавского \r\nв г. Ростове-на-Дону, Сочи (Краснодарский край и Ростовская область). \r\nВозможна аэросъёмка, панорамная видеосъёмка 360, съёмка с применением \r\nоператорского крана и под водой.\r\nРаботаем с подписанием договоров.', 'aljoh.rostov@mail.ru', '89896181230', 'aljoh.rostov@mail.ru', 'http://www.videografvarshavski.ru', 'https://vk.com/a.varshavsky', '', 'https://www.facebook.com/aljoh.rostov', '', '', '', NULL, 'aljoh.rostov', '2017-02-13', '', '2017-02-18', 1, '2017-02-15', 0, 1, 0),
(44, 'Olesyanovoselov', '9ab11e03e3e2a6ce0dc66fdee2cb04f5', '', 'Олеся', 'f', 'Новоселова', '', 'images/avatars/fb26867f6bbd8884e57a93fcc231e644.jpg', 84, '1994-01-05', 2, 0, 1, '', '2500', 'Монтаж видео Ващей свадьбы всегоза 20 дней!!!!\r\n\r\nНИ КАКИХ ГОЛУБКОВ И НЕВЕСТ НА ЛАДОШКЕ, Я ЗА СОВРЕМЕННЫЙ ПОДХОД! Видеосъемка на DSLR технику. В стоимость входит полный день работы и монтаж отснятого видеоматериала. Итогом работы будет фильм, в котором будут запечатлены все самые яркие события Вашего торжества и клип по материалам прогулки на музыкальную композицию по Вашему выбору.', 'Olesya.novoselov@mail.ru', '89180901226', 'Olesya.novoselov@mail.ru', 'http://sochi.gorko.ru/видеографы/549205/', 'https://vk.com/osya.nova', '', '', '', '', '', NULL, '', '2017-02-13', '', '2017-02-18', 1, '2017-02-14', 0, 1, 0),
