(4, 'Личное сообщение', '<p><br>Добрый день,хочу пригласить вас на фотосессию<br><br><br><br><p style="color: #aaa;">-----------</p><i style="font-size: 11px;">Данное письмо отправил(а):</i> <b>михаил</b>.<br><br/><i style="font-size: 11px;">Почтовый адрес, указанный отправителем:</i> <b>zm121@mail.ru</b></p>', '2017-05-24 10:15:32', 32),
